import React from 'react'
import style from '../Form/Form.module.scss'

class Form extends React.Component{
  render() {
	const {formOnSubmit} = this.props;
	event.preventDefault()
    return(
	  <form onSubmit={formOnSubmit} className={style.form}>
		{this.props.children}
	  </form>
	)
  }
}
export default Form
